INSERT INTO `field_data_body` VALUES ('node', 'topic_articles', '0', '99', '121', 'und', '0', 'It\'s the vacation most precious to you, signifying the very beginning of the rest of your life with the person you love most. While the destination is set and promises a peaceful, romantic break from the real world, the mere thought of packing is putting a bit of a damper on that glowing, ethereal quality of your soon-to-be honeymoon.\r\nNever fear – you simply need to follow a checklist of both major and easy-to-overlook essentials for an experience as lovely as when you both said, \"I do.\"\r\nRemember Your Travel Documents And Money.\r\nIf you’re going to forget something, forget your favorite watch, your socks you bought special for the trip or your iPod – you can still enjoy yourself without them. But do not, under any circumstances, forget any of the following:\r\nPassport: You’ll need this to get out of the country! Cover it up with a stylish passport case for safe keeping and to make it easier to find.\r\nDriver’s License/Photo I.D.: You’ll need this to get on the airplane and proving that you are the one who reserved that luxe resort stay. Very necessary and easily stowed in a travel wallet.\r\nTickets: Can’t get on the plane without them! Granted, you can often get by with just your photo I.D. at the airport, but it’s better to be safe than sorry. Tuck that boarding pass away in a safe case, too.\r\nAnd while you can always contact someone or do some online searches to recover important information, you should also bring along:\r\nCopies Of Receipts And Reservations: Print them all out and load a .PDF file to your tablet to avoid any frustrating run-ins with the customer service counter.\r\nA Contact List: Prepare a list just in case you misplace your cell phone.\r\nWhat Will You Wear?\r\nShowing up with seven trunks full of your entire wardrobe is not going to cut it. However, unless you’re backpacking across Europe, you at least have room for a few options. Break down your clothing into categories to avoid over-packing or showing up with 11 tops, one pair of pants and a complete lack of underwear:\r\nYour Undergarments: Bras. Undershirts. Underwear. Boxers. Socks.\r\nDaywear: Pack light with mix-and-match items for a ton of outfit options without the heavy suitcase.\r\nDressed-Up Nightwear: Throw in an all-black outfit and a pair of dress shoes, just in case.\r\nFootwear: Pack the two pairs you can’t live without. Add some comfortable shoes for your longer excursions.\r\nAccessories: Sunglasses. Scarves. Belts. Jewelry.\r\nSpecial Activity Wear: Hitting the beach? Pack a few bathing suits. Hitting the ski slopes? Remember your skiwear and accessories.\r\nSleepwear: For those days when you’re so tuckered out you both pass out the moment your heads hit the pillow – bring some comfy loungewear like sweats or classic pajamas. You’ll be glad you did.\r\nLingerie: That comfy loungewear isn’t very romantic!\r\nYour Destination Might Not Carry Your Personal Care Items.\r\nGuess what? That deodorant you finally found that does everything you want without making you smell like a bowl of tropical fruit – they just might not carry that where you’re headed. Bring the following:\r\nMedications: Over-the-counter and prescriptions.\r\nToiletries: Toothpaste, toothbrush, soap, deodorant, shampoo and conditioner.\r\nCosmetics: Makeup and hair products.\r\nGrooming Appliances: Electric shaver, hair dryer and flat iron.\r\nEyewear And Accessories: Glasses, contacts, cases and contact solution.\r\nTravel Pillow: So underrated.\r\nKeep Yourself Entertained And Charged.\r\nYes, you will certainly take up a good portion of your honeymoon looking lovingly into each other’s eyes but… there’s always the extremely long airplane ride and that moment when you realize your phone battery died and you forgot to bring your charger:\r\nReading Material: A paperback was never such a welcome friend.\r\nElectronic Devices: All of that fun stuff you use – tablet, eBook and MP3 player.\r\nChargers: For each electronic item, there is an ever-important charger.\r\nPower Converter: Your hair dryer’s plug might not be compatible with the hotel’s electrical outlets.\r\nCameras: Your friends and family will expect pictures.\r\nSD Cards: You might take more pictures than you ever imagined possible.\r\nPacking for your honeymoon may feel like quite the task but just one look at the love of your life reminds you everything you need is right by your side – so long as you remember your passports!', '', 'filtered_html');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_item', '0', '101', '123', 'und', '0', 'When someone asks you what your most versatile accessory is, if you answer handbag, watch, sunglasses or earrings, you’re overlooking the accessory that will never go out of style: your beautiful, shape-able and paint-able nails.\r\n \r\nThey’re the only accessory you can revamp on a daily basis without breaking the bank. And they’re so serious, there are writers out there putting a whole lot of effort into coming up with those adorable names you find on the top of the polish bottle. And beyond the vast sea of colors waiting to be enjoyed is a world full of nail art – designs that dreams are made of. So before you start tapping those fingertips on your tablet to find your next clutch or bracelet, take care of your nails first by cloaking them in one of 2013’s must-try trends.', '', 'filtered_html');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_item', '0', '102', '124', 'und', '0', 'Your beauty choices should always be a reflection of your inner personality. When it comes to infusing that personality into your manicure, you’ve got the opportunity to really achieve mirror-like reflection! High-shine metallic polish is in for 2013, so get your gleam on. If you don’t need a pair of sunglasses to take a safe glance, they’re not metallic enough! Essie ‘Mirror Metallics - No Place Like Chrome\' Nail Polish, $8, available at Nordstrom.', '', 'filtered_html');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_item', '0', '103', '125', 'und', '0', 'When you’re feeling a bit demure or you’re rocking a neon frock that doesn’t need any extra color competition, ease off of the high-impact nail trends and go for pure elegance. Nude nails are all over the runways, and they happen to make your fingers look long and slim – bonus points! Finding the nude that works best with your unique skin tone is a cinch when you wear “nail foundation” created for that very purpose. HIPPxRGB Nail Foundation, $16, available at Beauty.com.', '', 'filtered_html');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_item', '0', '104', '126', 'und', '0', 'All that glitters is gold, and now that can even include your nails. While you will find a ton of DIY options on Pinterest for carefully tapping insanely delicate gold leaf onto your nails (really, it’s quite a process), why not take the easy road to this luxe effect? Reach for a clear lacquer full of gold leaf pieces. The finished product is a marbleized effect that looks more like gold inlay than an easy-to-use topcoat. Rococo Gold Leaf Lacquer, $48, available at Beauty.com.', '', 'plain_text');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_slide_show', '0', '105', '147', 'und', '0', 'When someone asks you what your most versatile accessory is, if you answer handbag, watch, sunglasses or earrings, you’re overlooking the accessory that will never go out of style: your beautiful, shape-able and paint-able nails.\r\n \r\nThey’re the only accessory you can revamp on a daily basis without breaking the bank. And they’re so serious, there are writers out there putting a whole lot of effort into coming up with those adorable names you find on the top of the polish bottle. And beyond the vast sea of colors waiting to be enjoyed is a world full of nail art – designs that dreams are made of. So before you start tapping those fingertips on your tablet to find your next clutch or bracelet, take care of your nails first by cloaking them in one of 2013’s must-try trends.g', '', null);
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_denim', '0', '107', '129', 'und', '0', 'Have some cool guys to shop for on your holiday shopping list? Surprise them with a few extra smaller gifts this year! Stockings are the perfect place to hide small, practical and sometimes silly gifts, and can be filled randomly or with a theme of items. Our stocking stuffer picks for the guys will surely please and let them know that they were good this year!', '', 'filtered_html');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_fall_fashion', '0', '108', '130', 'und', '0', 'Ready to go green in 2013? And we\'re not talking about recycling bins here - we\'re talking style, because Pantone, the leading color authority, has chosen Emerald Green as the 2013 Color of the Year! This lively, radiant and lush hue is perfect for ringing in a new year full of abundance and prosperity and, because this jewel-toned green emits elegance and luxury, it\'s the perfect hue for adding color to your wardrobe. Whether you want to stun in a monochromatic ensemble, or make a statement with bold and colorful accessories, Emerald will be the must-have color in 2013!', '', 'filtered_html');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_eco_friendly', '0', '109', '131', 'und', '0', 'Juicing has been around for quite some time, but now more than ever it\'s become a popular and healthy way for people to reboot their bodies and, for some, it\'s a way of life. Whether you\'d like to detox from time to time, or simply want to incorporate more fruits and veggies into your daily diet, there\'s a juicer out there for every budget and need!', '', 'filtered_html');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_get_look', '0', '110', '132', 'und', '0', 'Glamorous. Sexy. Flirty; all signs point to Marilyn Monroe. This American icon\'s style has been mirrored for decades and you, too, can channel Marilyn with these great style picks. Whether you\'re feeling fun and flirty in a white halter, or sexy and sultry in a golden dress, we\'ve got what you want to create your own Marilyn Monroe inspired look.', '', 'filtered_html');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_women_essential', '0', '111', '133', 'und', '0', 'First dates are nerve-wracking because you just never know who you\'re going to get: the perfect gentleman or someone who makes you want to run away & hide. No matter how your date goes, Smarter.com has you covered with an arsenal of handbag friendly tools that will get you ready to pucker up or put your night out of its misery. You probably haven\'t been this prepared since your Girl Scout days.', '', 'filtered_html');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_thanksgiving', '0', '114', '151', 'und', '0', '<p>Treat your family and house guests to a complete and delicious breakfast including waffles, freshly squeezed juice, and bacon. Smarter.com can help you compare prices and save on the essentials you need to host the perfect family breakfast and make just about anything your cravings desire. Browse through <a href=\"http://www.smarter.com/coffee-makers/pl--ch-51--ca-372.html\" target=\"_self\">coffee makers</a>, <a href=\"http://www.smarter.com/juicers/pl--ch-51--ca-387.html\" target=\"_blank\">juicers</a>, and other <a href=\"http://www.smarter.com/se--qq-small%2Bkitchen%2Bappliances.html\" target=\"_blank\">small kitchen appliances</a> to get the entire family off to a good start.</p>', '', 'full_html');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_ten_stuffer', '0', '115', '137', 'und', '0', 'Buying gifts for men is difficult in general, but for Valentine\'s Day we\'ve made it easy for you by selecting a few great items that any man will love. From <a href=\"http://www.smarter.com/se--qq-video%2Bgames.html\" target=\"_blank\">video games</a> for your game fanatic date to <a href=\"http://www.smarter.com/knives/se--qq-pocket%2Bknives--pt-1--tt-32--cc-322.html\" target=\"_blank\">pocket knives</a> for your adventurous significant other, we have it all on Smarter.com.', '', 'full_html');
INSERT INTO `field_data_body` VALUES ('node', 'shop_guide_sale_module_b', '0', '117', '139', 'und', '0', 'There is no better motivation for working out, than working out in style! It\'s important to dress the part when you hit the pavement. We\'ve hand selected a few of our favorite work out essentials on sale, enjoy!', '', 'filtered_html');
