INSERT INTO `field_revision_body` VALUES ('node', 'shop_guide_ten_stuffer', '0', '115', '137', 'und', '0', 'Buying gifts for men is difficult in general, but for Valentine\'s Day we\'ve made it easy for you by selecting a few great items that any man will love. From <a href=\"http://www.smarter.com/se--qq-video%2Bgames.html\" target=\"_blank\">video games</a> for your game fanatic date to <a href=\"http://www.smarter.com/knives/se--qq-pocket%2Bknives--pt-1--tt-32--cc-322.html\" target=\"_blank\">pocket knives</a> for your adventurous significant other, we have it all on Smarter.com.', '', 'full_html');
